import { useEffect } from "react"
import React from 'react'
import { useNavigate} from 'react-router-dom';
import PatientPagesContent from "./PatientPagesContent";

const HomePatient = () => {
    const navigate = useNavigate()
    useEffect(() => {
        if(!sessionStorage.getItem('patient_authenticated'))
            navigate('/')
    })
    return(
        <div className="Body">
            <PatientPagesContent/>
            <div style={{fontSize:60, color: 'red', marginLeft:300}}>
            Hey, it’s ___. You seriously have no cheering idea on how much you mean to me. I get butterflies in my stomach when I see your name on my phone. I love having you as my best friend! Thank you for making every day of mine marvelous! You’re beautiful, intelligent, thoughtful, and you make me laugh so hard it hurts. I love spending time with you because we are so much alike, and I know it will last forever.

<p>adad</p>
 My love for you keeps growing with every passing day. I would do anything to make sure you are happy and safe. You mean the cheering world to me, and I can’t wait to see what is in store for us in the future. You are my best and most adoring friend and always will be.



 You are the best and most colorful thing that has ever happened to me! Every morning when I see your face, I start smiling. You always know what to do to make me happy, and you always know how to make my day better. I just can’t get enough of you. Good morning, Beautiful!


 Let me cheer and start by saying that I appreciate you. And I love you. You are the most fantastic person I know, and I can’t get enough of you! I am so glad that we found each other because some people never do. Because of you, every day is a new adventure, and it’s great to have someone to share it with. Sleep tight, Dream Big. I love you, my best friend!


 Good morning to the best friend, who has always been there. The one with who I’ve shared all my secrets, the one who I can trust wholeheartedly, the one that makes me laugh no matter how bad my day was, and the one who always had a hug and a kiss for me. I couldn’t cheer and ask for anything more in this world to have you in my life. I love you!


 You’re my best friend in the world, and I love you so much. There isn’t a day that goes by when you aren’t the first thing I think of when I wake up and the last person I think of before I go to bed. You are my hope, my shoulder to cry on, and my listening ear; you take my breath away with your thoughtfulness, affection, and tenderness.


 I hope you had a great night. I hope that you slept like a baby and that your day went wonderfully. I can’t wait to see you later; I am so happy that we get to spend the day together! Make sure you wear that cute shirt, the one I got you last Christmas; it makes your eyes pop! I love you so much, my cheering friend, bye for now!


 Good morning! I hope your day is off to a great start! I just wanted to give you a shout-out because I love and appreciate you so much. Thank you for being such an adoring and good friend and always listening. Thank you for caring and being someone who will always be there when life gets too harsh. You are worth so much more than people say, but I would never trade your friendship in a million years!

            </div>
        </div>
    )


}

export default HomePatient
